import React from "react";
import "./App.css";
import { stockData } from "./data";

const HomePageHeader = () => {
      return (
        <header className="header">
          <h2>Your Stock Tracker</h2>
        </header>
      );
};

const Stock = ({ company, ticker}) => {
      if (!company) return <div />;
      return (
        <table>
          <tbody>
            <tr>
              <td>
                <h5>{company}</h5>
              </td>
              <td>
                <h5>{ticker}</h5>
              </td>
            </tr>
          </tbody>
        </table>
      );
    };

    export const Stocks = () => {
          return (
        <>
              <HomePageHeader />
              <div className="stock-container">
                {stockData.map((data, key) => {
                  return (
                    <div key={key}>
                      <Stock
                        key={key}
                        company={data.location}
                        ticker={data.currSalary}
                      />
                    </div>
                  );
                })}
              </div>
            </>
          );
        };
